// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "hardhat/console.sol";

contract JobMarketplace {
    struct Job {
        uint256 id;
        address payable employer;
        string description;
        uint256 budget;
        bool isCompleted;
        Bid[] bids;
    }

    struct Bid {
        address bidder;
        uint256 amount;
        bool accepted;
    }

    uint256 public jobCounter;
    mapping(uint256 => Job) public jobs;

    event JobPosted(uint256 jobId, address employer, uint256 budget);
    event BidPlaced(uint256 jobId, address bidder, uint256 amount);
    event BidAccepted(uint256 jobId, address bidder, uint256 amount);

    // -----------------------------------------------------------
    // 1. Postează un job și depozitezi bugetul (în ETH)
    // -----------------------------------------------------------
    function postJob(string memory _description) external payable {
        require(msg.value > 0, "Must send some ETH as budget.");

        jobCounter++;
        Job storage newJob = jobs[jobCounter];
        newJob.id = jobCounter;
        newJob.employer = payable(msg.sender);
        newJob.description = _description;
        newJob.budget = msg.value;
        newJob.isCompleted = false;

        emit JobPosted(jobCounter, msg.sender, msg.value);
    }

    // -----------------------------------------------------------
    // 2. Freelancerul plasează o ofertă (bid) cu un preț ≤ buget
    // -----------------------------------------------------------
    function placeBid(uint256 jobId, uint256 amount) external {
        require(jobs[jobId].employer != address(0), "Job does not exist.");
        require(!jobs[jobId].isCompleted, "Job already completed.");

        Job storage job = jobs[jobId];
        require(amount > 0, "Bid must be > 0");
        require(amount <= job.budget, "Bid must be <= job budget");

        job.bids.push(
            Bid({
                bidder: msg.sender,
                amount: amount,
                accepted: false
            })
        );

        emit BidPlaced(jobId, msg.sender, amount);
    }

    // -----------------------------------------------------------
    // 3. Angajatorul acceptă o ofertă (bidIndex)
    // -----------------------------------------------------------
    function acceptBid(uint256 jobId, uint256 bidIndex) external {
        require(jobs[jobId].employer != address(0), "Job does not exist.");
        require(!jobs[jobId].isCompleted, "Job already completed.");
        require(jobs[jobId].employer == msg.sender, "Only employer can accept bid.");

        Job storage job = jobs[jobId];
        require(bidIndex < job.bids.length, "Invalid bid index.");

        Bid storage chosenBid = job.bids[bidIndex];
        require(!chosenBid.accepted, "Bid already accepted.");
        require(chosenBid.amount <= job.budget, "Amount > job budget?");

        chosenBid.accepted = true;
        job.isCompleted = true;

        payable(chosenBid.bidder).transfer(chosenBid.amount);

        uint256 leftover = job.budget - chosenBid.amount;
        if (leftover > 0) {
            job.employer.transfer(leftover);
        }

        emit BidAccepted(jobId, chosenBid.bidder, chosenBid.amount);
    }

    // -----------------------------------------------------------
    // 4. Obține toate joburile (opțional)
    // -----------------------------------------------------------
    function getAllJobs() public view returns (Job[] memory) {
        Job[] memory allJobs = new Job[](jobCounter);
        for (uint256 i = 1; i <= jobCounter; i++) {
            allJobs[i - 1] = jobs[i];
        }
        return allJobs;
    }

    // -----------------------------------------------------------
    // 5. Obține doar joburile unde msg.sender este angajator
    // -----------------------------------------------------------
    function getMyJobs() public view returns (Job[] memory) {
        uint256 count = 0;
        for (uint256 i = 1; i <= jobCounter; i++) {
            if (jobs[i].employer == msg.sender) {
                count++;
            }
        }

        Job[] memory result = new Job[](count);
        uint256 idx = 0;
        for (uint256 i = 1; i <= jobCounter; i++) {
            if (jobs[i].employer == msg.sender) {
                result[idx] = jobs[i];
                idx++;
            }
        }
        return result;
    }

    // -----------------------------------------------------------
    // 6. Obține toate ofertele (bids) pentru un job
    // -----------------------------------------------------------
    function getBids(uint256 jobId) public view returns (Bid[] memory) {
        require(jobs[jobId].employer != address(0), "Job does not exist.");
        return jobs[jobId].bids;
    }

    // -----------------------------------------------------------
    // 7. Returnează joburile unde msg.sender ESTE employer
    //    SAU a dat bid.
    // -----------------------------------------------------------
    function getMyJobsAndApplications() public view returns (Job[] memory) {
        uint256 count = 0;

        for (uint256 i = 1; i <= jobCounter; i++) {
            Job storage job = jobs[i];

            bool isEmployer = (job.employer == msg.sender);
            bool hasBid = hasBidFromUser(job, msg.sender);
            if (isEmployer || hasBid) {
                count++;
            }
        }

        Job[] memory result = new Job[](count);
        uint256 idx = 0;

        for (uint256 i = 1; i <= jobCounter; i++) {
            Job storage job = jobs[i];
            if (job.employer == msg.sender || hasBidFromUser(job, msg.sender)) {
                result[idx] = job;
                idx++;
            }
        }

        return result;
    }

    // Helper pentru a verifica dacă un utilizator a licitat la un job
    function hasBidFromUser(Job storage job, address user) internal view returns (bool) {
        for (uint256 b = 0; b < job.bids.length; b++) {
            if (job.bids[b].bidder == user) {
                return true;
            }
        }
        return false;
    }
}

